export const amritaEmailRegex = /^am\.[a-z]+\.\w+@am\.students\.amrita\.edu$/;
export const phoneRegex = /^[6-9]\d{9}$/;
export const passwordRegex = /^(?=.*[A-Z])(?=.*\d).{8,}$/;
export const usernameRegex = /^[a-zA-Z0-9_]{3,20}$/;
